import React from 'react';
import './RecValue.css';

const RecValue = () => {
    const isEmpty = props.isEmpty;
    if(isEmpty===false) {
        return <RecValue />
    }
    return (
        <div className='ma'>
        <div className='result'>
        <table className='ba bw2'>
        <thead>
          <tr>
            <th>Ingredients</th>
            <th>Prediction Value</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td></td>
            <td></td>
          </tr>
        </tbody>
      </table>
        

        </div> 

        </div>
    )
}

export default RecValue;
